import React, { Component } from 'react';
import { Nav, Navbar, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';
import swal from 'sweetalert';
import { connect } from 'react-redux';
class NavbarComps extends Component {

    logout = () => {
        swal({
            text: "Çıkış yapmak istiyor musunuz?",
            icon: "info",
            buttons: ["Hayır", "Evet"]
        }).then(_res => {
            if (_res === true) {

            }
        })
    }

    render() {
        const {User}=this.props;
        return (
            <div>
                <Navbar bg="light" expand="lg">
                    <Navbar.Brand href="#home">EGBA SİSTEM</Navbar.Brand>
                    <h4 style={{ marginLeft:600, marginRight: 130 }}>Hoşgeldin {User.name}</h4>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">

                            <Nav.Link style={{ marginLeft: 525, marginRight: 30 }} href="#home" >Home</Nav.Link>

                            <NavDropdown title={User.name} id="basic-nav-dropdown">
                                <NavDropdown.Item href="#action/3.1">Kurslarım</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">Market İsteklerim</NavDropdown.Item>
                                
                                <NavDropdown.Divider />
                                <NavDropdown.Item onClick={() => this.logout()}>Çıkış Yap</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>

                    </Navbar.Collapse>
                </Navbar>




            </div>
        )
    }
}
const MapStateToProps= _state=>{
    const {User}= _state.AuthenticationReducer;
    return {User};
}
export const NavBar=connect(MapStateToProps,null)(NavbarComps);
